import styled from "styled-components";

export const HeaderTransations = styled.div`
  background-color: var(--orangeCore);
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 25vh;
`;

export const BoxTitle = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
  padding: 1rem;

  img {
    width: 30px;
    height: 30px;
    margin-left: 10px;
  }
`;
